import React from 'react';
import './App.css';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "../node_modules/bootstrap/dist/js/bootstrap.bundle";
import {Switch, Route} from 'react-router-dom';
import Home from './components/Home';
import Art_craft from './components/Gallery/Art_craft';
import Art from './components/Gallery/Art&Craft/Art';
import Architec from './components/Gallery/Architec/Archi';
import Graphic from './components/Gallery/Graphic/Graphic';
import Port from './components/Gallery/Portraits/Portraits';


function App() {
  return (
    <Switch>
  <Route path="/" exact component={Home} />
  <Route path="/art_craft" exact component={Art_craft} />
  <Route path="/art" exact component={Art} />
  <Route path="/Architectural" exact component={Architec} />
  <Route path="/Graphic" exact component={Graphic} />
  <Route path="/portraits" exact component={Port} />
  
  </Switch>
  );
}

export default App;
